import React from 'react';
import '../../App.css';
import { BrowserRouter as Router, Switch, Route, useRouteMatch, Link } from 'react-router-dom';
import ClientDashboard from './ClientDashboard';
import ClientClinic from './ClientClinic';

export default function MenuforClient() {

  let { path, url } = useRouteMatch();

  return (
  <div className='menu'>
      <Router>
      <nav className='sidenavbar'>
      <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/f/f4/Font_Awesome_5_solid_user-circle.svg/1200px-Font_Awesome_5_solid_user-circle.svg.png"
            class="sidenavbarlogo"
            alt="Logo" />

        <ul className='sidenav-menu'>
            <li className='sidenav-item'>
                <Link to={`${url}/dashboard`}
                className='sidenav-links'>
                Dashboard
                </Link>
            </li>
            <li className='sidenav-item'>
                <Link to={`${url}/clinics`}
                className='sidenav-links'>
                Clinic 
                </Link>
            </li>
        </ul>
      </nav>
        <Switch>
          <Route exact path={`${path}/dashboard`} component={ClientDashboard} />
          <Route path={`${path}/clinics`} component={ClientClinic} />
        </Switch>
    </Router>
    </div>
  )
}
